import React from 'react';
import styled from 'styled-components';
import Token from './Token'
const TableStyled= styled.div`
display: grid;
grid-template-columns: 130px 130px;
justify-content: center;
justify-items: center;
grid-gap: 50px;
margin: 2em 0 ;
position: relative;
& div:nth-of-type(3){
    grid-column: span 2;
}
.line{
    height: 15px; 
    background: rgba(0,0,0,.5);
    position: absolute;
    left: 60px;
    right: 60px;
    top: 60px;
    &:before{
    content: '';
    height: 15px; 
    background: rgba(0,0,0,.5);
    position: absolute;
    left: 0px;
    right: 0px;
    top: 0px;
    transform: rotate(60deg);
    transform-origin: left top;
}
&:after{
    content: '';
    height: 15px; 
    background: rgba(0,0,0,.5);
    position: absolute;
    left: 0px;
    right: 0px;
    top: 0px;
    transform: rotate(-60deg);
    transform-origin: right top;
}
}


`

export default function Table() {
    return (
        <TableStyled>
            <span className="line"></span>
             <Token name="paper"/>        
             <Token name="scissors"/> 
             <Token name="rock"  /> 
        </TableStyled>
    )
}
